const messages = {
  decline: 'decline',
  approveTx: 'approveTx',
  disconnect: 'disconnect',
  complete: 'complete',
  sent: 'sent',
  failed: 'failed',
  signMessage: 'signMessage',
  error: 'error',
  notConnected: 'notConnected',
  declineMessage: 'declineSignMessage'
};

export default messages;
